INSERT INTO `lk_sanctions` (`id`, `name`) VALUES 
(1, 'الحضور المتاخر لأكثر من ربع ساعة'),
(2, 'الخروج المبكر لأكثر من ربع ساعة '),
(3, 'الغياب بدون اذن او عذر '),
(4, 'الغياب المستمر لأكثر من 7 ايام '),
(5, 'مغادرة موقع العمل او التسكع اثناء ساعات العمل '),
(6, 'النوم او القراءة اثناء ساعات العمل او غير الوقت المخصص للراحة '),
(7, 'مخالفة التعليمات الخاصة المتعلقة بالعمل او عدم إطاعة الرؤساء '),
(8, 'رفض العمل كلياً او الاضراب عن العمل او تحريض الاخرين علي التوقف من العمل بعد الاثبات '),
(9, 'الاهمال الذي يؤدي الي خسارة جسيمة بعد الاثبات '),
(10, 'انتحال شخصية الغير او تقديم اوراق مزورة بغرض الحصول علي العمل بعد الاثبات '),
(11, 'استعمال الالات والمواد لأغراض شخصية او لمصلحة الاخرين '),
(12, 'عدم مراعاة التعليمات الواجب اتباعها لسلامة العاملين وسلامة الشركة او التدخين في الاماكن المحظور فيها'),
(13, 'المشاجرة والاعتداء علي الرؤساء او الزملاء اعتداء جسيم يعاقب عليه القانون '),
(14, 'الادانة وفي جريمة تمس الشرف والامانة او ارتكاب عمل مخل بالاداب في مكان العمل او ملحقاته '),
(15, 'افشاء اسرار الشركة الصناعية او التجارية في غير ما يسمح به القانون'),
(16, 'ادعاء المرض حسب اثبات الطبيب او رفض الكشف الطبي '),
(17, 'تشويه او نزع الاعلانات او اتلاف المستندات الخاصة بالشركة او الغير '),
(18, 'السكر البين او الوقوع تحت تأثير مخدر اثناء ساعات العمل الرسمية بعد اثبات الطبيب او الادانة الجنائية '),
(19, 'مخالفة المبادئ المهنية والسياسات التحريرية في النص اوالصورة اوالصوت');
